import React from 'react';
import { Paper, Tabs, Tab } from "@material-ui/core";

const Home = () => {

    return (
        <div>
            <h3>Andrew Rueter Poetry</h3>
            <Paper>
                <Tabs>
                    <Tab>Poems</Tab>
                    <Tab>Films</Tab>
                    <Tab>Stories</Tab>
                </Tabs>
            </Paper>
        </div>
    )
}

export default Home;
